from collections import defaultdict

input = ""

freq = defaultdict(int)
for i in range(14):
    freq[input[i]] += 1

for i in range(14, len(input)):
    freq[input[i]] += 1
    freq[input[i-14]] -= 1
    
    if freq[input[i-14]] == 0:
        freq.pop(input[i-14])

    if len(freq) == 14:
        print(i+1)
        break
    
